import React from "react";
import { Col, Row } from "react-bootstrap";
import Products from "../products";
function HomeScreen() {
  return (
    <>
      <Row>
        {Products.map((products) => (
          <Col>
            <h3>{products.name}</h3>
          </Col>
        ))}
      </Row>
    </>
  );
}

export default HomeScreen;
